import React from "react";
import Habit from "./Habit";

const habits = [
  "Sleep & Recovery",
  "Occupation & Focus",
  "Physical Activity & Breathwork",
  "Nutrition & Digestion",
];

export default function Habits() {
  return (
    <div>
      {habits.map((habit) => {
        return <Habit title={habit} />;
      })}
    </div>
  );
}
